Define the actual action block that will be called. This command is required Examples: # If you do not need to process any arguments:
action :command do # your code here
end # if you want to handle arguments defined in `usage`:
action :command do |args| # your code here # access any argument with arg['--flagname'] or arg['<arg>']
end # If you wish to use commands with hyphen, simply use single quotes:
action :'drink-beer' do # your code here
end # To define an alias (shortcut) to a command, use:
action :command, :c do # your code here
end See Also : Alias Example
